import React, {Component} from 'react'
import SecondaryNavigation from './SecondaryNavigation'

class MyNewspaper extends Component {

    render() {
        return (
            <div>
                <h2>MyNewspaper</h2>
                <SecondaryNavigation />
            </div>
        )
    }
}

export default MyNewspaper;
